import React from 'react';

function Home() {

    const homeBodyContaier = {
        padding: "10px",
        marginTop: "20%",
        marginLeft: "35px"
      };

    const name = {
        fontSize: "80px",
        letterSpacing: "10px",
        fontWeight: "300",
        marginTop: "10px"
    }

    return (
    <div style={homeBodyContaier}>
        <h1 style={{fontWeight: "900"}}>HELLO, MY NAME IS</h1>
        <h1 style={name}>LAUREN CAMERON</h1>
    </div>
    )};

  export default Home;
